import React, { useState, useEffect } from 'react';

const UserLogin = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleUsernameChange = (event) => {
    setUsername(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle login logic here with 'username' and 'password'
    console.log('Login submitted:', { username, password });
  };
 const resetLoginForm = (event)=>{
    setUsername('');
    setPassword('');
 }
  return (
    <div className="form">
      <form onSubmit={handleSubmit}>
        <div className="input-container">
          <label>Username </label>
          <input type="text" name="uname" value={username} onChange={handleUsernameChange} required />
        </div>
        <div className="input-container">
          <label>Password </label>
          <input type="password" name="pass" value={password} onChange={handlePasswordChange} required />
        </div>
        <div className="button-container">
          <input type="submit" value="Login" />
        </div>
        <div className="button-container">
          <input type="submit" value="Reset" onClick={resetLoginForm} />
        </div>
      </form>
    </div>
  );
};

export default UserLogin;
